import React, { Component, View, Image } from 'react';
import Imagem from './foto.jpg';

class Imagens extends Component {

    render() {
        return (
            <View style={styles.container}>
            <Image 
                key = {Imagem.background}
                source = {Imagem.background}
                style = {styles.backgroundStyle}
                resizeMode = 'stretch'
            />

            <Container style={styles.transparentView}>
                <View style={styles.logoViewStyle}>
                    <Image 
                        key = {Imagem.logo}
                        source = {Imagem.logo}
                        resizeMode = 'contain'
                        style = {styles.logoStyle}
                    />
                </View>
            </Container>
        </View>

        )
    }
}

  const styles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center'
    },
  
    backgroundStyle: {
      flex: 1,
      position: 'relative'
    },
  
    transparentView: {
      flex: 1,
      backgroundColor: 'transparent',
      justifyContent: 'center',
      position: 'absolute'
  },
  });

  export default Imagens;
